con:configuration.path:
declare namespace soap='http://schemas.xmlsoap.org/soap/envelope/';
declare namespace m='http://www.oorsprong.org/websamples.countryinfo';


<Result>
{
for $z in //m:tCountryCodeAndName
return <m:sName>{data($z/m:sName/starts-with(text(),'G'))}</m:sName>
}
</Result>

con:configuration.scriptText:
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def responseHolder = groovyUtils.getXmlHolder(messageExchange.responseContent)


def countryName = responseHolder.getNodeValue("//m:tCountryCodeAndName/m:sName");
def countryCode = responseHolder.getNodeValue("//m:tCountryCodeAndName/m:sISOCode");


assert countryName ==  "Andorra"
assert countryCode == "AD"
